D\" title=\"\u041f\u0435\u043a\u0438\u043d\">\u041f\u0435\u043a\u0438\u043d\u0430<\/a> \u0432 \u043e\u0441\u0432\u043e\u0431\u043e\u0436\u0434\u0451\u043d\u043d\u044b\u0439 \u0440\u0430\u0439\u043e\u043d \u041a\u0430\u043c\u0431\u043e\u0434\u0436\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1979\" class=\"mw-redirect\" title=\"1979\">1979<\/a>&#160;\u2014 \u0432\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0435 \u043e\u0448\u0438\u0431\u043a\u0438 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u043a\u043e\u043c\u043f\u044c\u044e\u0442\u0435\u0440\u0430 \u0441\u0438\u0441\u0442\u0435\u043c\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/NORAD\" class=\"mw-redirect\" title=\"NORAD\">NORAD<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BC%D0%B0%D0%BD%D0%B4%D0%BE%D0%B2%D0%B0%D0%BD%D0%B8%D0%B5_%D0%B2%D0%BE%D0%B7%D0%B4%D1%83%D1%88%D0%BD%D0%BE-%D0%BA%D0%BE%D1%81%D0%BC%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%BE%D0%B9_%D0%BE%D0%B1%D0%BE%D1%80%D0%BE%D0%BD%D1%8B_%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D0%BE%D0%B9_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u041a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435 \u0432\u043e\u0437\u0434\u0443\u0448\u043d\u043e-\u043a\u043e\u0441\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043e\u0431\u043e\u0440\u043e\u043d\u044b \u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u041a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435 \u0432\u043e\u0437\u0434\u0443\u0448\u043d\u043e-\u043a\u043e\u0441\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043e\u0431\u043e\u0440\u043e\u043d\u044b \u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u0410\u043c\u0435\u0440\u0438\u043a\u0438<\/a>\\North American Aerospace Defense Command), \u0441\u043e\u043e\u0431\u0449\u0438\u0432\u0448\u0435\u0433\u043e \u043e \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u043c \u044f\u0434\u0435\u0440\u043d\u043e\u043c \u043d\u0430\u043f\u0430\u0434\u0435\u043d\u0438\u0438, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BB%D1%83%D1%87%D0%B0%D0%B8_%D0%BB%D0%BE%D0%B6%D0%BD%D0%BE%D0%B3%D0%BE_%D1%81%D1%80%D0%B0%D0%B1%D0%B0%D1%82%D1%8B%D0%B2%D0%B0%D0%BD%D0%B8%D1%8F_%D1%81%D0%B8%D1%81%D1%82%D0%B5%D0%BC_%D0%BF%D1%80%D0%B5%D0%B4%D1%83%D0%BF%D1%80%D0%B5%D0%B6%D0%B4%D0%B5%D0%BD%D0%B8%D1%8F_%D0%BE_%D1%80%D0%B0%D0%BA%D0%B5%D1%82%D0%BD%D0%BE%D0%BC_%D0%BD%D0%B0%D0%BF%D0%B0%D0%B4%D0%B5%D0%BD%D0%B8%D0%B8\" title=\"\u0421\u043b\u0443\u0447\u0430\u0438 \u043b\u043e\u0436\u043d\u043e\u0433\u043e \u0441\u0440\u0430\u0431\u0430\u0442\u044b\u0432\u0430\u043d\u0438\u044f \u0441\u0438\u0441\u0442\u0435\u043c \u043f\u0440\u0435\u0434\u0443\u043f\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u044f \u043e \u0440\u0430\u043a\u0435\u0442\u043d\u043e\u043c \u043d\u0430\u043f\u0430\u0434\u0435\u043d\u0438\u0438\">\u0432 \u0421\u0428\u0410 \u043e\u0431\u044a\u044f\u0432\u043b\u0435\u043d\u0430 \u044f\u0434\u0435\u0440\u043d\u0430\u044f \u0442\u0440\u0435\u0432\u043e\u0433\u0430<\/a>. \u0412 \u0442\u0435\u0447\u0435\u043d\u0438\u0435 \u0434\u0435\u0441\u044f\u0442\u0438 \u043c\u0438\u043d\u0443\u0442 \u043c\u0438\u0440 \u043d\u0430\u0445\u043e\u0434\u0438\u043b\u0441\u044f \u043d\u0430 \u043a\u0440\u0430\u044e \u044f\u0434\u0435\u0440\u043d\u043e\u0439 \u0432\u043e\u0439\u043d\u044b. \u041f\u043e\u0437\u0434\u043d\u0435\u0435 \u0431\u044b\u043b\u043e \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043e, \u0447\u0442\u043e \u043f\u0440\u0438\u0447\u0438\u043d\u043e\u0439 \u0438\u043d\u0446\u0438\u0434\u0435\u043d\u0442\u0430 \u0441\u0442\u0430\u043b\u0430 \u043a\u043e\u043c\u043f\u044c\u044e\u0442\u0435\u0440\u043d\u0430\u044f \u043b\u0435\u043d\u0442\u0430, \u043f\u0440\u0435\u0434\u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u043d\u0430\u044f \u0434\u043b\u044f \u043e\u0442\u0440\u0430\u0431\u043e\u0442\u043a\u0438 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0439 \u043f\u0440\u0438 \u0440\u0430\u043a\u0435\u0442\u043d\u043e\u043c \u043d\u0430\u043f\u0430\u0434\u0435\u043d\u0438\u0438, \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u0431\u044b\u043b\u0430 \u043e\u0448\u0438\u0431\u043e\u0447\u043d\u043e \u0437\u0430\u0433\u0440\u0443\u0436\u0435\u043d\u0430 \u0432 \u043a\u043e\u043c\u043f\u044c\u044e\u0442\u0435\u0440, \u043d\u0430\u0445\u043e\u0434\u044f\u0449\u0438\u0439\u0441\u044f \u043d\u0430 \u0431\u043e\u0435\u0432\u043e\u043c \u0434\u0435\u0436\u0443\u0440\u0441\u0442\u0432\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1981\" class=\"mw-redirect\" title=\"1981\">1981<\/a>&#160;\u2014 \u0432 \u041d\u0430\u0433\u0430\u0448\u0438\u043c\u0435 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u042f\u043f\u043e\u043d\u0438\u044f\">\u042f\u043f\u043e\u043d\u0438\u044f<\/a>) \u043f\u043e\u0434\u043d\u0438\u043c\u0430\u0435\u0442\u0441\u044f \u0432 \u0432\u043e\u0437\u0434\u0443\u0445 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0432\u043e\u0437\u0434\u0443\u0448\u043d\u044b\u0439 \u0448\u0430\u0440 Double Eagle V, \u0441\u043e\u0432\u0435\u0440\u0448\u0438\u0432\u0448\u0438\u0439 \u043f\u0435\u0440\u0435\u043b\u0451\u0442 \u0447\u0435\u0440\u0435\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B8%D1%85%D0%B8%D0%B9_%D0%BE%D0%BA%D0%B5%D0%B0%D0%BD\" title=\"\u0422\u0438\u0445\u0438\u0439 \u043e\u043a\u0435\u0430\u043d\">\u0422\u0438\u0445\u0438\u0439 \u043e\u043a\u0435\u0430\u043d<\/a>, \u0441 \u043a\u0430\u043f\u0438\u0442\u0430\u043d\u043e\u043c \u0411\u0435\u043d\u043e\u043c \u0410\u0431\u0440\u0443\u0446\u0446\u0438 \u0438 \u0447\u043b\u0435\u043d\u0430\u043c\u0438 \u043a\u043e\u043c\u0430\u043d\u0434\u044b \u041b\u0430\u0440\u0440\u0438 \u041d\u044c\u044e\u043c\u0435\u043d\u043e\u043c, \u0420\u043e\u043d\u043e\u043c \u041a\u043b\u0430\u0440\u043a\u043e\u043c \u0438 \u044f\u043f\u043e\u043d\u0446\u0435\u043c \u0420\u043e\u043a\u043a\u0438 \u0410\u043e\u043a\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1983\" class=\"mw-redirect\" title=\"1983\">1983<\/a>&#160;\u2014 \u043c\u0438\u043d\u0438\u0441\u0442\u0440 \u0438\u043d\u043e\u0441\u0442\u0440\u0430\u043d\u043d\u044b\u0445 \u0434\u0435\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%82%D0%B0%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%9D%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D0%B0%D1%8F_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u041a\u0438\u0442\u0430\u0439\u0441\u043a\u0430\u044f \u041d\u0430\u0440\u043e\u0434\u043d\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u041a\u0438\u0442\u0430\u0439\u0441\u043a\u043e\u0439 \u041d\u0430\u0440\u043e\u0434\u043d\u043e\u0439 \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438<\/a> \u043e\u0431\u044a\u044f\u0432\u043b\u044f\u0435\u0442 \u043e \u043d\u0430\u043c\u0435\u0440\u0435\u043d\u0438\u0438 \u043a\u0438\u0442\u0430\u0439\u0441\u043a\u043e\u0433\u043e \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0441\u0442\u0432\u0430 \u0432 \u043e\u0434\u043d\u043e\u0441\u0442\u043e\u0440\u043e\u043d\u043d\u0435\u043c \u043f\u043e\u0440\u044f\u0434\u043a\u0435 \u043e\u0431\u044a\u044f\u0432\u0438\u0442\u044c \u043e \u0432\u043e\u0441\u0441\u043e\u0435\u0434\u0438\u043d\u0435\u043d\u0438\u0438 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D0%BD%D0%BA%D0%BE%D0%BD%D0%B3\" title=\"\u0413\u043e\u043d\u043a\u043e\u043d\u0433\">\u0413\u043e\u043d\u043a\u043e\u043d\u0433\u043e\u043c<\/a> \u0432 \u0441\u0435\u043d\u0442\u044f\u0431\u0440\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1984\" class=\"mw-redirect\" title=\"1984\">1984<\/a> \u0432 \u0442\u043e\u043c \u0441\u043b\u0443\u0447\u0430\u0435, \u0435\u0441\u043b\u0438 \u043d\u0435 \u0431\u0443\u0434\u0435\u0442 \u0434\u043e\u0441\u0442\u0438\u0433\u043d\u0443\u0442\u043e \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435 \u043f\u043e \u044d\u0442\u043e\u043c\u0443 \u0432\u043e\u043f\u0440\u043e\u0441\u0443 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0435\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1984\" class=\"mw-redirect\" title=\"1984\">1984<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A9%D1%91%D0%BB%D0%BE%D0%BA%D0%BE%D0%B2,_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_%D0%90%D0%BD%D0%B8%D1%81%D0%B8%D0%BC%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0429\u0451\u043b\u043e\u043a\u043e\u0432, \u041d\u0438\u043a\u043e\u043b\u0430\u0439 \u0410\u043d\u0438\u0441\u0438\u043c\u043e\u0432\u0438\u0447\">\u041d\u0438\u043a\u043e\u043b\u0430\u0439 \u0429\u0451\u043b\u043e\u043a\u043e\u0432<\/a>, \u0431\u044b\u0432\u0448\u0438\u0439 \u043c\u0438\u043d\u0438\u0441\u0442\u0440 \u0432\u043d\u0443\u0442\u0440\u0435\u043d\u043d\u0438\u0445 \u0434\u0435\u043b \u0421\u0421\u0421\u0420, \u043b\u0438\u0448\u0451\u043d \u0432\u043e\u0438\u043d\u0441\u043a\u043e\u0433\u043e \u0437\u0432\u0430\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D0%BB_%D0%B0%D1%80%D0%BC%D0%B8%D0%B8_(%D0%A1%D0%A1%D0%A1%D0%A0)\" title=\"\u0413\u0435\u043d\u0435\u0440\u0430\u043b \u0430\u0440\u043c\u0438\u0438 (\u0421\u0421\u0421\u0420)\">\u0433\u0435\u043d\u0435\u0440\u0430\u043b\u0430 \u0430\u0440\u043c\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1985\" class=\"mw-redirect\" title=\"1985\">1985<\/a>&#160;\u2014 \u043f\u043e\u0431\u0435\u0434\u0438\u0432 \u0432 \u043c\u0430\u0442\u0447\u0435 \u0437\u0430 \u0448\u0430\u0445\u043c\u0430\u0442\u043d\u0443\u044e \u043a\u043e\u0440\u043e\u043d\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%BF%D0%BE%D0%B2,_%D0%90%D0%BD%D0%B0%D1%82%D0%BE%D0%BB%D0%B8%D0%B9_%D0%95%D0%B2%D0%B3%D0%B5%D0%BD%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041a\u0430\u0440\u043f\u043e\u0432, \u0410\u043d\u0430\u0442\u043e\u043b\u0438\u0439 \u0415\u0432\u0433\u0435\u043d\u044c\u0435\u0432\u0438\u0447\">\u0410\u043d\u0430\u0442\u043e\u043b\u0438\u044f \u041a\u0430\u0440\u043f\u043e\u0432\u0430<\/a> \u0441\u043e \u0441\u0447\u0451\u0442\u043e\u043c 13:11, \u0442\u0440\u0438\u043d\u0430\u0434\u0446\u0430\u0442\u044b\u043c \u0447\u0435\u043c\u043f\u0438\u043e\u043d\u043e\u043c \u043c\u0438\u0440\u0430 \u043f\u043e \u0448\u0430\u0445\u043c\u0430\u0442\u0430\u043c \u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0441\u044f 22-\u043b\u0435\u0442\u043d\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%81%D0%BF%D0%B0%D1%80%D0%BE%D0%B2,_%D0%93%D0%B0%D1%80%D1%80%D0%B8_%D0%9A%D0%B8%D0%BC%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041a\u0430\u0441\u043f\u0430\u0440\u043e\u0432, \u0413\u0430\u0440\u0440\u0438 \u041a\u0438\u043c\u043e\u0432\u0438\u0447\">\u0413\u0430\u0440\u0440\u0438 \u041a\u0430\u0441\u043f\u0430\u0440\u043e\u0432<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1986\" class=\"mw-redirect\" title=\"1986\">1986<\/a>&#160;\u2014 \u043a \u0438\u0437\u0440\u0430\u0438\u043b\u044c\u0441\u043a\u043e\u043c\u0443 \u0443\u0447\u0451\u043d\u043e\u043c\u0443-\u044f\u0434\u0435\u0440\u0449\u0438\u043a\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D0%BD%D1%83%D0%BD%D1%83,_%D0%9C%D0%BE%D1%80%D0%B4%D0%B5%D1%85%D0%B0%D0%B9\" title=\"\u0412\u0430\u043d\u0443\u043d\u0443, \u041c\u043e\u0440\u0434\u0435\u0445\u0430\u0439\">\u041c\u043e\u0440\u0434\u0435\u0445\u0430\u044e \u0412\u0430\u043d\u0443\u043d\u0443<\/a>, \u0437\u0430\u0434\u0435\u0440\u0436\u0430\u043d\u043d\u043e\u043c\u0443 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\">\u041b\u043e\u043d\u0434\u043e\u043d\u0435<\/a> \u043f\u043e\u0441\u043b\u0435 \u0442\u043e